import React, { Component } from 'react';
import { Button, Grid } from '@mui/material';
import SendIcon from '@mui/icons-material/Send';

const Home = () => {
    return (
        <>
            <Grid style={{ marginTop: '1rem' }}>
                <Button variant='contained' endIcon={<SendIcon />}>
                    hello world
                </Button>
            </Grid>
        </>
    );
};

export default Home;
